    return (
        <div className='partner-signup container mt-5'>
            <div className='row mt-5 pt-5'>
                <div className='col-lg-2 offset-2 col-md-8 col-10 shadow p-lg-5 p-md-4 p-3 me-2'>

                </div>
                <div className='col-lg-6 col-md-8 col-10 ms-2'>
                    <h3 className='d-flex justify-content-start fw-3'>Restaurant Information</h3>
                </div>
            </div>
        </div>
    )
}

export default SignUp;
